/* eslint-disable jsx-a11y/alt-text */
import { AppBar, Button, IconButton, Link, Toolbar } from "@mui/material";
import LOGO from "../assets/logos/solxraf_navbar.png";
import { navbarLinks, socialLinks } from "../../database/NavbarData";
import { useState } from "react";
import { NavbarCSS } from "./NavbarCSS";
import NavButton from "../buttons/NavButton";

const Navbar = () => {
  const links = {
    color: "#fff",
    textDecoration: "none",
    textTransform: "capitalize",
    padding: "23px",
    fontWeight: "700",
    "&:hover": {
      backgroundColor: "#fff2",
    },
  };

  return (
    <AppBar sx={NavbarCSS.appbar} elevation={0}>
      <Toolbar>
        <div style={NavbarCSS.image}>
          <img src={LOGO} style={{ width: "15vw" }} />
        </div>
        <div style={{ flex: 4, display: "flex", justifyContent: "center" }}>
          {navbarLinks.map((data, i) => (
            <NavButton
              index={i}
              key={i}
              onClick={data.onClick}
              to={data.to}
              name={data.name}
            />
          ))}
        </div>
        <div style={{ flex: 1, display: "flex", justifyContent: "center" }}>
          {socialLinks.map((data, i) => (
            <IconButton size="small">{data.icon}</IconButton>
          ))}
        </div>
      </Toolbar>
    </AppBar>
  );
};

export default Navbar;
